    [],nt"revision_timestamp": "2016-07-27T22:19:45.047652",nt"name": "hunting-plan-malheur-national-wildlife-refuge",nt"isopen":
    false,nt"url": null,nt"notes": "The purpose of this plan is to provide
    guidelines for administration of hunting activity and for development, maintenance,
    and enforcement of regulations and guidelines on Malheur National Wildlife Refuge.
    It addresses the areas of information, access, use patterns, regulations, area restrictions,
    permits, and enforcement. This will become a reference as well as working document
    to which refuge personnel can refer for specific information on the hunting program
    at Malheur Refuge. This plan is based primarily on wildlife values that exist or
    will exist on the refuge.  Hunting is allowed on three units- the Malheur Lake Unit,
    the Buena Vista Unit, and the Boundary Unit.",nt"license_title": "License
